import React from "react";
import styled from "styled-components/native";

const View = styled.View`
  justify-content: center;
  align-items: center;
  flex: 1;
`;

const Text = styled.Text``;

export default () => (
  <View>
    <Text>Confirm</Text>
  </View>
);
